[[package]]
name = "proxy-scraper-checker"
version = "0.0.0"
source = { editable = "." }
dependencies = [
    { name = "aiofiles" },
    { name = "aiohttp" },
    { name = "aiohttp-socks" },
    { name = "attrs" },
    { name = "brotli", marker = "implementation_name == 'cpython'" },
    { name = "brotlicffi", marker = "implementation_name != 'cpython'" },
    { name = "certifi" },
    { name = "charset-normalizer" },
    { name = "maxminddb" },
    { name = "platformdirs" },
    { name = "rich" },
    { name = "tomli", marker = "python_full_version < '3.11'" },
    { name = "winloop", marker = "(implementation_name == 'cpython' and sys_platform == 'cygwin') or (implementation_name == 'cpython' and sys_platform == 'win32')" },
]

[package.optional-dependencies]
non-termux = [
    { name = "aiodns" },
    { name = "uvloop", marker = "(implementation_name == 'cpython' and sys_platform == 'darwin') or (implementation_name == 'cpython' and sys_platform == 'linux')" },
]
nuitka = [
    { name = "nuitka" },
]

[package.dev-dependencies]
dev = [
    { name = "mypy" },
    { name = "ruff" },
    { name = "tomli" },
    { name = "types-aiofiles" },
    { name = "typing-extensions" },
]

[package.metadata]
requires-dist = [
    { name = "aiodns", marker = "extra == 'non-termux'", specifier = ">=1.1,<4" },
    { name = "aiofiles" },
    { name = "aiohttp", specifier = ">=3.8.6,<4" },
